Due to adverse weather conditions and flooding Customers are advised to defer travel if possible. The 19:30 Casino to Sydney XPT service is replaced by road coach with an altered route and stops. Customers for Coffs Harbour and Grafton will be connected with a service at Casino. This Service will travel along the New England Highway direct to Maitland. No services possible for customers travelling to Sawtell, Urunga, Macksville, Kempsey, Wauchope, Kendal, Taree, Wingham, Gloucester and Dungog, .This service will stop as per timetable between Maitland and Sydney.<br /><br /><br /><br />
